import React from "react";

const MyRoutes = () => {
    return (
        <>
            <Routes>
                <Route path="/" Component={()=><Home/>}/>
                <Route path="/service" Component={()=><Service/>}/>
                <Route path="/about" Component={()=><About/>}/>
                <Route path="/contact" Component={()=><ContactUs/>}/>
            </Routes>
        </>
    )
}

export default MyRoutes;
